import React from "react";
import { Container, Table } from "react-bootstrap";
import "../../Assets/CitasMedico.css";
import { data } from "../../data/dataCitasMedico";
import { Link } from "react-router-dom";

let datos = JSON.parse(JSON.stringify(data));

const Fecha = (props) => {
  return (
    <table id="citas">
      <tr>
        <th scope="col">Nombre</th>
        <th scope="col">Hora</th>
        <th scope="col">Fecha</th>
        <th scope="col">Llamar</th>
      </tr>
      <tr>
        <td scope="row">{props.paciente}</td>
        <td scope="row" id="hora">
          {props.fecha}
        </td>
        <td scope="row" id="doctor">
          {props.hora}
        </td>
        <td scope="row" id="asistir">
          <Link className="btn btn-success" to="codigo">
            Llamar paciente
          </Link>
        </td>
      </tr>
    </table>
  );
};

const Fechas = (props) => {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12">
          <table id="citas">
      <tr>
        <th scope="col">Nombre</th>
        <th scope="col">Hora</th>
        <th scope="col">Fecha</th>
        <th scope="col">Llamar</th>
      </tr>
      <tr>
        <td scope="row">{props.paciente}</td>
        <td scope="row" id="hora">
          {props.fecha}
        </td>
        <td scope="row" id="doctor">
          {props.hora}
        </td>
        <td scope="row" id="asistir">
          <Link className="btn btn-success" to="codigo">
            Llamar paciente
          </Link>
        </td>
      </tr>
    </table>
          </div>
        </div>
      </div>
    );
};

export const CitasMedico = () => {
  return datos.map((arrDatos, idx) => {
  return (
    <Container>
      <Fechas 
      key={idx}
      paciente={arrDatos[0]}
      hora={arrDatos[1]}
      fecha={arrDatos[2]}/>
    </Container>
  );
});
};
export default CitasMedico;
